  <div>
    <GlobalStyles />

    <FlexWrapper>
      <Sidebar />
      <ChildWrapper>
      {children}
      </ChildWrapper>

    </FlexWrapper>


  </div>
);
const FlexWrapper = styled.div`
  display:flex;
